import React from "react";

const AdvancedAnalysis = ({ advancedAnalysis }) => {
    if (!advancedAnalysis || Object.keys(advancedAnalysis).length === 0) {
        return <div>No advanced analysis data</div>;
    }

    return (
        <div className="advanced-analysis-section">
            <div className="section-title">üîç Advanced AI Analysis</div>
            <div>Job Level: {advancedAnalysis.job_level || "Unknown"}</div>
            <div>Processing Time: {advancedAnalysis.processing_time || "Unknown"}s</div>
        </div>
    );
};

export default AdvancedAnalysis;
